    onButtonClickEliminarTodoImagenes: function(button, e, eOpts) {
        var msgFuncion = function(){
            var formRegistro  = 'formUnidadUsada';
            var apiController = 'apiUnidadUsada';
            var apiMethod     = 'borrarImagenesUnidad';

            var objJsonData     = new Object();
            objJsonData.codigo  = elf.readElement('tfCodigo');
            objJsonData.modelo  = elf.readElement('cbxModelo');

            var objJsonRequest = new Object();
            objJsonRequest.apiController = apiController;
            objJsonRequest.apiMethod     = apiMethod;
            objJsonRequest.apiData       = JSON.stringify(objJsonData);

            var functionSuccess = function(){
                var jsonData = elf.getInfoDataBridge(apiMethod);

                elf.showInfo(jsonData, 'information');
                Ext.getCmp('tabPanelGaleria').actualizaImagenes();
            };

            var functionFailure = function(){
                var jsonData = elf.getInfoDataBridge(apiMethod);
                elf.showInfo(jsonData, 'error');
            };

            elf.doDataBridge(objJsonRequest,
                             functionSuccess,
                             null,
                             functionFailure,
                             null);
        };

        msgTipo      = 'question';
        msgTitulo    = 'Eliminar imagenes almacenadas de la Unidad';
        msgContenido = 'Desea eliminar las imágenes de la Unidad Usada con Codigo: ' + elf.readElement('tfCodigo') + '?';

        elf.message(msgTipo,msgTitulo,msgContenido,msgFuncion);



    },

